package snowblozm.remote;import org.json.JSONObject;import org.json.JSONArray;import snowblozm.interfaces.Service;import snowblozm.interfaces.Block;import snowblozm.interfaces.Sequence;import snowblozm.core.SBException;/** *	@class RemoteServiceWorkflow *	@desc Remote service proxy * *	@author Vibhaj Rajan <vibhaj8@gmail.com> ***/public class RemoteServiceWorkflow implements Service {		/**	 *	@constructor	**/	public RemoteServiceWorkflow(String uri, String root, String key){		}		/**	 *	@interface Service	**/	public Block input() throws SBException {		return new JSONObject();	}		/**	 *	@interface Service	**/	public Block run(Block memory) throws SBException {		return memory;	}		/**	 *	@interface Service	**/	public Sequence output() throws SBException {		return new JSONArray();	}	}